BEGIN TRANSACTION;
CREATE TABLE web_events (
	id bpchar,
	account_id bpchar,
	occurred_at timestamp,
	channel bpchar	
);
CREATE TABLE sales_reps (
	id bpchar,
	name bpchar,
	region_id bpchar	
);
CREATE TABLE region (
	id bpchar,
	name bpchar	
);
CREATE TABLE orders (
	id bpchar,
	account_id bpchar,
	occurred_at timestamp,
	standard_qty numeric,
	gloss_qty numeric,
	poster_qty numeric,
	total numeric,
	standard_amt_usd numeric,
	gloss_amt_usd numeric,
	poster_amt_usd numeric,
	total_amt_usd numeric
);
CREATE TABLE accounts (
	id bpchar,
	name bpchar,
	website bpchar,
	lat numeric,
	long numeric,
	primary_poc bpchar,
	sales_rep_id bpchar
);
COMMIT;
